  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Under prospective payment, Medicare pays
  home health agencies (HHAs) a predetermined base payment. The payment is adjusted
  for the health condition and care needs of the beneficiary. The payment is also
  adjusted for the geographic differences in wages for HHAs across the country. The
  adjustment for the health condition, or clinical characteristics, and service needs
  of the beneficiary is referred to as the case-mix adjustment. The home health PPS
  will provide HHAs with payments for each 60-day episode of care for each beneficiary.</p>n\",\n\t\"license_title\":
